// Cameron McCarty
// 09/11/2023

import headerClass from './classes.module.css';

function Header() {
    return (
        <header className={headerClass.header} >
            <div className={headerClass.headerLogo}></div>
            <h1>T2me</h1>
        </header>
    )
}

export default Header;
